import logo from './logo.svg';
import './App.css';
import React from 'react';
import Login from "./Login";
import Home from "./Home";
import Registration from './Registration';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Plant Buddy
        </p>

      </header>
      <Registration />
      <Login />
    </div>
  );
}

export default App;
